import React, { Component} from 'react';
import { Container, Row, Col } from "react-bootstrap";
import axios from 'axios';
import Couriers from './Couriers';
import Configuration from './Configuration';
import Orders from './Orders';

export default class Form extends Component {
    state = {
        maxDeliveryTimeMinutes:0,
        assignments:[1]
    }

    async componentDidMount() {/*
        const url = 'http://localhost:8080/couriers';
        const response = await axios.get(url);
        const receivedAssingments = JSON.stringify(response.data.assignments);
        const arrayOfAssignmets = JSON.parse(receivedAssingments);
        this.setState({assignments:arrayOfAssignmets})
        */
    }

    render(){
        return(
            <div>
                <Container className="mt-5 pt-5 main">
                    The best food order for the available couriers is:
                    {this.state.assignments[0].courierId}
                    <Row>
                        <Col>
                            <Couriers/>
                        </Col>
                        <Col>
                            <Orders/>
                        </Col>
                        <Col>
                            <Configuration/>
                        </Col>
                    </Row>
                </Container>
            </div>
        );
    }
}
